        function searchStudent() {
            const nisn = document.getElementById("nisnInput").value.trim();
            if (database[nisn]) {
                document.getElementById("studentName").innerText = database[nisn].name;
                document.getElementById("studentNISN").innerText = nisn;

                let menuHTML = "";
                database[nisn].menus.forEach(menu => {
                    menuHTML += `<tr>
                                    <td>${menu.menu}</td>
                                    <td>${menu.score}</td>
                                    <td>${menu.rank}</td>
                                 </tr>`;
                });

                document.getElementById("menuData").innerHTML = menuHTML;
                document.getElementById("searchBox").style.display = "none";
                document.getElementById("resultBox").style.display = "block";
            } else {
                alert("NISN not found!");
            }
        }

        function goBack() {
            document.getElementById("resultBox").style.display = "none";
            document.getElementById("searchBox").style.display = "block";
            document.getElementById("nisnInput").value = "";
        }
